    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Tewaukon NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Tewaukon NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, USFWS mission and goals, management
    strategies by unit, and implementation and monitoring strategies. Key planning issues
    include: habitat management, wildlife, endangered species, public use, recreation,
    and partners.",nt"license_title": "License Not Specified",nt"extras":
